import React, { useState } from "react";
import { StatusBar } from "expo-status-bar";
import {
	StyleSheet,
	Text,
	View,
	Image,
	SafeAreaView,
	Button,
} from "react-native";

export default function MySquad() {
	const [showModal, setShowModal] = useState(false);

	return (
		<SafeAreaView style={styles.container}>
			<View style={styles.marginContainer}>
				<View style={{ height: 30, backgroundColor: "blue" }}>
					<Button title="Add new squad" onPress={() => setShowModal(true)} />
				</View>
			</View>
		</SafeAreaView>
	);
}

const styles = StyleSheet.create({
	container: {
		flex: 1,
		backgroundColor: "#fff",
	},
	genreMenuImg: {
		width: 70,
		height: 70,
	},
	marginContainer: {
		marginHorizontal: "3%",
		marginTop: "1%",
		height: "100%",
		alignItems: "center",
		justifyContent: "center",
	},
});

